(async()=>{try{const t=await fetch("https://frontend.tabling.co.kr/v1/store/9533/reservations",{method:"GET",headers:{"Content-Type":"application/json"}}),e=await t.json();return console.info(e),e}catch(t){console.error("Error:",t)}})().then((t=>{(t=>{const e=document.getElementById("reservation-list");t.filter((t=>"done"!==t.status)).forEach((t=>{const n=(t=>{const e="reserved"===t.status?"예약":"착석 중",n="reserved"===t.status?"#3BB94C":"#162149",s=t.customer.name,r=t.tables.map((t=>t.name)).join(", "),o=t.customer.adult,a=t.customer.child,i=t.menus.map((t=>`${t.name}(${t.qty})`)).join(", ");return`\n    <div class="reservation-item">\n      <div class="reservation-time-status" style="color: ${n}">\n        <p>${t.timeReserved}</p>\n        <p>${e}</p>\n      </div>\n      <div class="reservation-details">\n        <p>${s} - ${r}</p>\n        <p>성인 ${o} 아이 ${a}</p>\n        <p>${i}</p>\n      </div>\n      <div class="reservation-action">\n        <button class="seat-button">${"reserved"===t.status?"착석":"퇴석"}</button>\n      </div>\n    </div>\n  `})(t);e.innerHTML+=n}))})(t.reservations)}));